function onArcDown() {
	console.log('@spray: An arc failed to establish.');
	if (this.partialView.length() > 0) {
		const rn = Math.floor(Math.random() * this.partialView.length());
		this.neighborhoods.connect(null, this.partialView.array.arr[rn]);
	}
}

